<h3>History</h3>
<p>European University was established in 1995 as the first non-governmental higher education institution in Georgia. It was founded with the mission to provide quality education that meets international standards and to prepare students to become competent and responsible professionals in their respective fields.</p>


<p>Since its establishment, European University has been continuously expanding its academic programs and enhancing its facilities to cater to the growing demand for higher education in Georgia.</p>

<h3>Programs</h3>
<p>European University offers a range of undergraduate and postgraduate programs in different fields of study. Some of its most popular programs include:</p>

<p>Medicine: The Faculty of Medicine offers a six-year Doctor of Medicine (MD) program, which is designed to provide students with a strong foundation in basic sciences and clinical practice.</p>

<p>Business: The Faculty of Business and Economics offers undergraduate and postgraduate programs in business administration, marketing, finance, and international business.</p>

<p>Law: The Faculty of Law offers a five-year Bachelor of Laws (LLB) program, as well as a one-year Master of Laws (LLM) program in various areas of law.</p>

<p>Social Sciences and Humanities: The Faculty of Social Sciences and Humanities offers undergraduate and postgraduate programs in psychology, international relations, journalism, and English philology.</p>

<h3>Facilities</h3>
<p>European University is equipped with modern facilities to provide a conducive learning environment for its students. Its campus is located in Tbilisi, the capital city of Georgia, and consists of several academic buildings, a library, a computer lab, and a student center.</p>

<p>The university has also established partnerships with several hospitals and clinics in Tbilisi, where its medical students can gain practical experience and training.</p>


<h3>Admission Requirements</h3>
<p>To be admitted to European University, prospective students must submit their academic records and other supporting documents, such as a statement of purpose and recommendation letters. The university also requires all applicants to take an entrance exam, which may vary depending on the program of study.</p>

<h3>Tuition and Fees</h3>
<p>The tuition and fees for European University vary depending on the program of study. However, the university offers a range of scholarships and financial aid programs to assist students who may need financial assistance.</p>

